import{_ as t}from"./chunks/immortalwrt.BUmB0cxm.js";import{_ as o,c as a,o as i,ag as r}from"./chunks/framework.KLbWPeN7.js";const l="/images/ax660011.png",e="/images/AX66003.png",s="/images/AX66002.png",n="/images/ax66005.png",m="/images/%E8%BF%9B%E5%85%A5%E4%B8%B4%E6%97%B6uboot.png",_="/images/uboot%E5%8D%87%E7%BA%A7.png",u="/images/gpt%E5%88%86%E5%8C%BA%E5%8D%87%E7%BA%A7.png",T=JSON.parse('{"title":"京东云AX6600雅典娜刷机教程 ，高通9008刷OpenWRT教程","description":"","frontmatter":{},"headers":[],"relativePath":"flash-tutorials/ax6600.md","filePath":"flash-tutorials/ax6600.md"}'),c={name:"flash-tutorials/ax6600.md"};function b(h,p,g,A,f,d){return i(),a("div",null,p[0]||(p[0]=[r('<h1 id="京东云ax6600雅典娜刷机教程-高通9008刷openwrt教程" tabindex="-1">京东云AX6600雅典娜刷机教程 ，高通9008刷OpenWRT教程 <a class="header-anchor" href="#京东云ax6600雅典娜刷机教程-高通9008刷openwrt教程" aria-label="Permalink to &quot;京东云AX6600雅典娜刷机教程 ，高通9008刷OpenWRT教程&quot;">​</a></h1><ul><li><p>WIFI7都发布了，是时候升级到WIFI6了，几年前的wifi6路由器京东云雅典娜AX6600，这是京东云的第一款三频Wi-Fi 6无线路由器，强悍的性能，超大的空间，当年上市需要800多元，虽然跑豆子能回血，但是感觉还是太贵了，等了3年，今天海鲜市场159包邮拿下。</p></li><li><p>参数方面，这款路由器采用高通 IPQ6010 处理器，4核CPU，1.8G频率，还有一个独立的单核1.5GHz NPU用于网络加速引擎，1G内存，满血wifi6，再加上 8 颗独立信号放大器，实现 6600 兆级 160MHz 高频宽，还有 LED 点阵屏、128G eMMC 工业级存储，跑docker嘎嘎香！</p></li><li><p>据介绍，这款路由器支持游戏专属 5.2G 频段、三频 Mesh、4K QAM、OFDMA &amp;MU-MIMO 等，可与其他京东云路由混合无线组网，特色功能还包括自动赚积分可兑换京豆和 E 卡（日上限 888）；可看时间、天气、积分、速率等。底部有个彩色氛围灯，可以通过颜色指示路由器状态，顶部有两个按钮切换显示和指示状态。前面板上面有操作指引，先扫二维码下载它的app大致试下路由器好坏。</p></li><li><p>下载好app，插上网线，在插电开机，连上设备wifi，简单测试下没啥问题，各个接口，网络速率都没毛病，查看设备的软件版本，可以看到是最新的4533版，那就只能用9008模式刷机了。</p></li></ul><h2 id="📦-准备工作" tabindex="-1">📦 准备工作 <a class="header-anchor" href="#📦-准备工作" aria-label="Permalink to &quot;📦 准备工作&quot;">​</a></h2><ul><li>1.京东云AX6600雅典娜 一台，1G内存，128G存储。</li><li>2.准备一跟网线，一台windows系统电脑。</li><li>3.下载刷机工具包，固件我已经打包好了放在网盘里面，兄弟们自取！</li></ul><blockquote><p>📺 视频教程：<br><a href="https://youtu.be/KmNV3VFS8_c" target="_blank" rel="noreferrer">点击观看 YouTube 视频教程</a></p></blockquote><p>京东云AX6600刷机工具包：</p><p>仅需 ¥2.8元 <a href="/shop/ax6600.html">👉 立即购买</a>（网盘发货，收集固件录制视频不易感谢支持！）</p><p><img src="'+l+'" alt="CasaOS界面"></p><p>一、拆机</p><p>1、首先跟着视频教程拆机，找到短接触点，过程要小心，千万别弄坏了主板！</p><p><img src="'+e+'" alt="CasaOS界面"></p><p>2、主板照片！</p><p><img src="'+s+'" alt="CasaOS界面"></p><p>3、短接触点在这里哦！短接 R656 和 GND 针脚</p><p><img src="'+n+'" alt="CasaOS界面"></p><p>4、安装驱动，连接电脑和路由器，然后用9008模式进入UBOOT。</p><p>二、输入不死UBOOT</p><ol><li>雅典娜和亚瑟一样用短接触点开启高通9008模式刷机</li></ol><p>好处是：不受任何系统版本限制，坏处是：需要拆机，短接</p><p>但刷入不死uboot之后，一劳永逸。</p><ol start="2"><li>进入 9008 模式</li></ol><p>短接 R656 和 GND 针脚（保持）</p><p>然后上电，听到叮咚一声，识别成功，不用再短接了</p><p>打开设备管理器，查看端口里面有个 Qualcomm 的设备，我这里为 COM3，记下 3</p><ol start="3"><li>刷写临时 uboot</li></ol><p>打开 USB命令.bat</p><p>选择 2 京东云AX6600雅典娜</p><p>输入 COM端口号, 我刚才为3，这里就输入 3，然后 按 enter</p><p>等待 SBL1 完成，程序会暂停，准备第二次刷入 注意！！，这个地方非常关键，刷入 uboot 的过程，非常快，如果不及时操作，临时的 uboot 就进不去，那么就必须回第一步短接重新开始。</p><p>按下 Enter 之后继续，看到雅典娜灯变红，立刻按住 RESET，然后 红灯会闪烁，5 下之后，会变蓝，然后可以松手了，此时，临时 uboot 就进去了。</p><p><img src="'+m+'" alt="CasaOS界面"></p><ol start="4"><li>配置网络IP</li></ol><p>IP：192.168.1.2 网关：192.168.1.1 子网掩码：255.255.255.0</p><ol start="5"><li>访问 192.168.1.1进入临时Uboot界面，此时的 uboot 掉电就没了，那么想要一直用 uboot，需要把它刷写到 rom 里。</li></ol><p>访问 192.168.1.1/uboot.html</p><p>注意地址！，只有 uboot.html 才可以刷，不要搞错了！</p><p>选择文件 选择 亚瑟雅典娜通用不死uboot uboot-JDC_AX1800_Pro-AX6600_Athena-20240510.bin, 点击 Update U-Boot</p><p>此时会闪烁蓝光，完成刷写之后会亮绿光（3s），接着就会重启。</p><p>断电 按住 RESET（保持），上电 看到红灯闪烁，直到蓝灯，就进入到了 uboot。（如果进不去需要重复上面的步骤） 这个时候就不再需要再进入到 9008 模式了。也就是说不死uboot刷入成功了。可以把雅典娜组装起来了。</p><p><img src="'+_+'" alt="CasaOS界面"></p><p>三、刷GPT分区表</p><p>注意：因为原厂固件GPT分区很小，只能刷入6OM一下的固件，直接刷入超过60M的固件会导致开机一直红灯,不能自动获取IP地址，所有需要刷入GPT大分区表！</p><p>访问 <a href="http://192.168.1.1/img.html" target="_blank" rel="noreferrer">http://192.168.1.1/img.html</a></p><p>根据自己设备和需求刷入对应的512/1G/2G的GPT分区，我的设备是128g的我就直接选最大2G分区了。</p><p>刷入GPT分区：gpt-JDC_AX6600_Athena_dual-boot_rootfs2048M_no-last-partition.bin</p><p>刷完以后等两分钟，路由器会长亮红灯。直接下电，按reset进uboot就行。</p><p>刷完GPT分区后，就可以愉快的刷入大部分factory固件了。</p><p><img src="'+u+'" alt="CasaOS界面"></p><p>四、刷入OpenWrt固件</p><p>可以按照视频步骤重新进入 u-boot 界面，刷入各种OpenWrt 固件。</p><p>istoreos固件 ip地址：192.168.1.1 用户名：root 密码：password</p><p>immortalwrt固件</p><p>ip地址：192.168.1.1 用户名：root 密码：root</p><p>openwrt 固件</p><p>ip地址：192.168.5.1 用户名：root 密码：password</p><p>五、2.5G网口切换</p><p>雅典娜提供了一个2.5G网口，默认分给WAN口，显然WAN口用不上这么大的，除非你是2000兆宽带，我把它改到LAN口给NAS用，再合适不过了！</p><p>先修改lan口的设置，在物理设置里，取消勾选eth0，把eth4（2.5G网口）勾选上</p><p>再进wan口和wan6口的设置，更改物理接口到eth0</p><p>保存应用后，路由器最右边的接口就变成wan口了，2.5G口直接给nas就ok了。</p><p>分区格式化和挂载 由于我们刷的GPT分区是不带最后一个分区的，需要自己分区、格式化硬盘、挂载。</p><ul><li>最后登录路由器后台修改设置wifi，添加机场！ok！</li><li>收集整理不容易！记得视频点赞关注就是对我最大的支持！</li></ul><p><img src="'+t+'" alt="CasaOS界面"></p>',63)]))}const P=o(c,[["render",b]]);export{T as __pageData,P as default};
